import logo from "../../images/logo.svg";
import { Link } from "react-router-dom";

const LeftNav = () => {
  const handleClose = (e) => {
    // buat tombol close untuk navbar mobile version
  };

  return (
    <div className="nav-tool flex lg:justify-between lg:px-0 px-6 lg:w-3/5 w-3/5 ">
      <button>
        <svg width="20" height="20" xmlns="http://www.w3.org/2000/svg" className="lg:hidden ">
          <path d="M16 12v3H0v-3h16Zm0-6v3H0V6h16Zm0-6v3H0V0h16Z" fill="#69707D" fillRule="evenodd" />
        </svg>
      </button>
      <div className="logo logo flex items-center lg:ml-0 ml-6 ">
        <img src={logo} alt="logo" />
      </div>
      <ul className="navbar-menu lg:text-blue-3 lg:flex justify-evenly content-center lg:w-2/3  absolute inset-y-0 left-0 sm:w-2/3 w-5/6 px-4 bg-white-2 font-bold text-black">
        {/* close button */}
        <li className=" py-6 mb-6">
          <svg width="20" height="20" xmlns="http://www.w3.org/2000/svg">
            <path d="m11.596.782 2.122 2.122L9.12 7.499l4.597 4.597-2.122 2.122L7 9.62l-4.595 4.597-2.122-2.122L4.878 7.5.282 2.904 2.404.782l4.595 4.596L11.596.782Z" fill="#69707D" fillRule="evenodd" />
          </svg>
        </li>
        <li className="lg:py-10 py-2  lg:hover:border-primary-1 hover:text-black border-b-transparent border-b-4 ">
          <Link className="">Collections</Link>
        </li>
        <li className="lg:py-10 py-2  lg:hover:border-primary-1 hover:text-black border-b-transparent border-b-4">
          <Link className="">Men</Link>
        </li>
        <li className="lg:py-10 py-2  lg:hover:border-primary-1 hover:text-black border-b-transparent border-b-4">
          <Link>Women</Link>
        </li>
        <li className="lg:py-10 py-2  lg:hover:border-primary-1 hover:text-black border-b-transparent border-b-4">
          <Link>About</Link>
        </li>
        <li className="lg:py-10 py-2  lg:hover:border-primary-1 hover:text-black border-b-transparent border-b-4">
          <Link>Contact</Link>
        </li>
      </ul>
    </div>
  );
};

export default LeftNav;
